create table uaa_menu_permission
(
    ID            bigint auto_increment comment '主键'
        primary key,
    MENU_ID       varchar(36) charset utf8mb4 not null comment '菜单id',
    PERMISSION_ID varchar(36) charset utf8mb4 not null comment '权限(接口)id',
    UPDATE_TIME   datetime                    null comment '修改时间',
    CREATE_TIME   datetime                    null comment '修改时间'
)
    comment '菜单权限绑定表' collate = utf8mb4_unicode_ci
                             row_format = DYNAMIC;

